<template>
	<div>
		<Headerbtns :title=title></Headerbtns>
		<div class="main-contents" :class="isSucc?'succ':'fail'">
			<img v-show="isSucc" :src="pay_succ" style="width: 50%;margin-top: 10%;position: relative;z-index: 10;" />
			<img v-show="!isSucc" :src="pay_fail" style="width: 50%;margin-top: 10%;position: relative;z-index: 10;" />
			<div class="detail">
				<p style="font-size:22px;color:#333;text-align: center;" v-show="isSucc">恭喜您！</p>
				<p style="font-size:22px;color:#333;text-align: center;" v-show="!isSucc">很遗憾！</p>
				<p>{{result.resultMessage}}</p>
				<div style="border-top: 1px solid #ddd;padding: 5% 1%;margin: 7% 0;" v-show="isSucc">
					<p v-if="result.point!='0'">保单过犹豫期后，您将获得<span style="color:blue;">{{result.point}}</span>积分。</p>
					<p v-if="result.customerLevel!=''&&result.customerLevel!='04'&&result.point!='0'">您现在是<span style="color:blue;">{{result.customerLevel | filterLevel}}</span>，拥有<span style="color:blue;">{{result.levelPoint}}</span>积分，距下一级别还差<span style="color:blue;">{{result.nextLevelPoint}}</span>积分。</p>
					<p v-if="result.customerLevel=='04'">您现在是 <span style="color:blue;">{{result.customerLevel | filterLevel}}</span>，拥有<span style="color:blue;">{{result.levelPoint}}</span>积分。</p>
					<p v-if="result.customerLevel!=''&&newCustomerLevel!=result.customerLevel&&result.point!='0'">该保单过犹豫期后，您将成为<span style="color:blue;">{{newCustomerLevel | filterLevel}}</span>，拥有<span style="color:blue;">{{newLevelPoint}}</span>积分。</p>
					<p @click="showInfo()" style="color:blue;text-decoration: underline;margin-top: 15%;">相关详细内容请点击查看</p>
				</div>
				<div style="display: flex;justify-content: space-around;align-items: center;" :class="isSucc?'':'top'">
					<button @click="go('/Home')">返回首页</button>
					<button v-show="result.payStatus == '1'" @click="goToReceipt()">回执签收</button>
					<button v-show="result.payStatus == '2'" @click="go('/Backlog')">待办事项</button>
					<button v-show="result.payStatus == '3'" @click="goPay()">继续支付</button>
				</div>
			</div>
		</div>
		<mt-popup v-model="showImgs" position="right" class="show_img">
			<mt-header title="积分详情">
				<mt-button @click="backPage" slot="left">
					<i class="fa fa-angle-left"></i>
				</mt-button>
			</mt-header>
			<div style="width: 100%;height: 100%;overflow: auto;">
				<img src="../../../static/img/backlog/info.jpg" @click="clickEnlarge(0)" class="enlarge" />
				<img src="../../../static/img/backlog/infos.jpg" @click="clickEnlarge(1)" class="enlarge" />
			</div>
		</mt-popup>
	</div>
</template>

<script>
	import Headerbtns from '../policy/common/Header.vue'
	import '../policy/css/base.css'
	import { Popup } from 'mint-ui'
	export default {
		name: 'insureResult',
		components: {
			Headerbtns,
			Popup
		},
		data() {
			return {
				pay_succ: 'data:image/png;base64,',
				pay_fail: 'data:image/png;base64,',
				result: this.$route.params.result,
				isSucc: true,
				isEnlarge: false,
				isEnlargeIndex: '',
				title: '投保成功',
				newCustomerLevel: '', //新客户级别
				newLevelPoint: '', //新级别积分
				showImgs: false,
			}
		},
		filters: {
			filterLevel(code) {
				let text = ''
				if(code == '01') {
					text = '普通客户'
				} else if(code == '02') {
					text = '三星级客户'
				} else if(code == '03') {
					text = '四星级客户'
				} else if(code == '04') {
					text = '五星级客户'
				}
				return text
			},
		},
		mounted() {
			console.log('result===>>', this.result)
			if(this.result.resultCode == 0) {
				this.isSucc = true
				this.title = '投保成功'
				this.newLevelPoint = Number(this.result.levelPoint) + Number(this.result.point)
				this.newCustomerLevel = this.filterPoint(this.newLevelPoint)
			} else {
				this.isSucc = false
				this.title = '投保失败'
			}
		},
		methods: {
			filterPoint(point) {
				let code = ''
				if(point < 3000) {
					code = '01'
				} else if(point >= 3000 && point < 5000) {
					code = '02'
				} else if(point >= 5000 && point < 10000) {
					code = '03'
				} else if(point >= 10000) {
					code = '04'
				}
				return code
			},
			goPay() {
				this.$router.push({
					name: 'pay',
					params: {
						orderId: this.$route.params.orderId,
					}
				});
			},
			goToReceipt() {
				this.$router.push({
					name: 'receipt',
					params: {
						orderId: this.$route.params.orderId
					}
				})
			},
			showInfo() {
				this.showImgs = true
			},
			clickEnlarge(index) {
				let list = document.getElementsByClassName('enlarge')
				list[0].style.cssText = "width: 100%;"
				list[1].style.cssText = "width: 100%;"
				if(this.isEnlarge == false) {
					this.isEnlarge = true
					this.isEnlargeIndex = index
					list[index].style.cssText = "width: 150%;"
				} else if(this.isEnlarge == true && this.isEnlargeIndex != index) {
					this.isEnlargeIndex = index
					list[index].style.cssText = "width: 150%;"
				} else if(this.isEnlarge == true && this.isEnlargeIndex == index) {
					this.isEnlarge = false
				}
			},
			backPage() {
				this.showImgs = !this.showImgs
				this.isEnlarge = false
				this.isEnlargeIndex = ''
			}
		}
	}
</script>

